import logo from './logo.svg';
import List from './Components/ul';
import './App.css';

class App extends React.Component
{
    componentDidMount()
  {
    console.log('onPage')
  } 
  componentWillUnmount()
  {
    console.log('off')
  }
  state={ 
      value : "",
      todo : [],
  };

  saveTodo = ()=>
  {
    const {value,todo} = this.state;
    todo.push(value);
    this.setState({todo : todo,value : ""})
  }

  render()
  {
    const {value,todo} = this.state;
    return (
      <div>
        <List todo={todo} />
      </div>
    )
  }
}


export default App;
